import { React, useEffect, useState } from "react";
import axios from "axios";

const Kategorije = () => {
  const [data, setData] = useState({ hits: [] });
  useEffect(async () => {
    const result = await axios("http://localhost:5000/kategorije/");

    setData(result.data);
  });
  return (
    <ul id="predmeti">
      <li className="predmet">Naziv</li>
    </ul>
  );
};

export default Kategorije;
